  false,\n\t\"url\": null,\n\t\"notes\": \"Waterfowl banding on Adak Island, Alaska,
  was conducted between 2 August and 2 October 1981. Trap locations were baited three
  days prior to trap construction. Four traps were set for a total of 248 trap days.
  Bait was discontinued on 28 September, ten days prior to the opening of waterfowl
  season. Banding terminated on 2 October, when traps were removed.\",\n\t\"owner_org\":
